def find_kth_character(k):
    n = 1
    while True:
        if n * (n + 1) // 2 >= k:
            break
        n += 1

    # Calculate the position within the last segment
    segment_length = n - 1
    position_in_segment = (k - 1) % segment_length

    # Convert the position to the corresponding character
    return chr(ord('a') + position_in_segment)

